        private static byte SwapBits(byte chunk, int[] bits) {
            byte num = 0;
            for(var i = 0; i < 8; i++) {
                var num3 = (byte)((chunk & 1 << (bits[i] & 0x1f)) >> bits[i]);
                num = (byte)(num << 1 | num3);
            }
            return num;
        }

        public byte[] ConvertFcrtToCr(ref byte[] decryptedFcrt) {
            if(!_crypto.VerifyFcrtDecrypted(ref decryptedFcrt))
                throw new X360UtilsException(X360UtilsException.X360UtilsErrors.DataNotDecrypted);
            var cr = new List<byte>();
            var tmp = new byte[0x10];
#if CRRandom
            foreach(var i in GetRandomOrder((decryptedFcrt.Length - 0x140) / 0x20)) {
#else
            for (var i = 0; i < (decryptedFcrt.Length - 0x140) / 0x20; i++) {
#endif
                cr.Add(decryptedFcrt[(i * 0x20) + 0x140]);
                cr.Add(decryptedFcrt[(i * 0x20) + 0x140 + 1]);
                cr.Add(decryptedFcrt[(i * 0x20) + 0x140 + 15]);
                Buffer.BlockCopy(decryptedFcrt, (i * 0x20) + 0x140 + 0x10, tmp, 0, tmp.Length);
                cr.AddRange(tmp);
            }
            tmp = cr.ToArray();
            var bits = new[] {
                                 3, 2, 7, 6, 1, 0, 5, 4
                             };
            for(var i = 0; i < tmp.Length; i++)
                tmp[i] = SwapBits((byte)(tmp[i] ^ XorTable[i]), bits);
            return tmp;
        }

#if CRRandom
        private static IEnumerable<int> GetRandomOrder(int max) {
            var list = new List<int>();
            var rnd = new Random();
            for(var i = 0; i < max; i++) {
                while(true) {
                    var val = rnd.Next(0, max);
                    if(list.Contains(val))
                        continue;
                    list.Add(val);
                    break;
                }
            }
            return list.ToArray();
        }
#endif

        public void ExtractJungleFlasherData(string nandfile, string cpukey, string outdir) { ExtractJungleFlasherData(nandfile, StringUtils.HexToArray(cpukey), outdir); }

        public void ExtractJungleFlasherData(string nandfile, byte[] cpukey, string outdir) { ExtractJungleFlasherData(new NANDReader(nandfile), cpukey, outdir); }

        public void ExtractJungleFlasherData(NANDReader nandReader, string cpukey, string outdir) { ExtractJungleFlasherData(nandReader, StringUtils.HexToArray(cpukey), outdir); }

        public void ExtractJungleFlasherData(NANDReader nandReader, byte[] cpukey, string outdir) {
            var origdir = Directory.GetCurrentDirectory();
            try
            {
                if (!Directory.Exists(outdir))
                    Directory.CreateDirectory(outdir);
                Directory.SetCurrentDirectory(outdir);
                var fcrt = _nand.GetFcrt(nandReader);
                _crypto.DecryptFcrt(ref fcrt, cpukey);
                File.WriteAllBytes("c-r.bin", ConvertFcrtToCr(ref fcrt));
                var kv = _nand.GetKeyVault(nandReader, cpukey);
                File.WriteAllBytes("key.bin", _kvutils.GetDVDKeyBytes(ref kv));
            }
            finally {
                Directory.SetCurrentDirectory(origdir);
            }
        }
    }
